import axios         from 'axios';

const server = 'http://localhost:5000';

export const todoList = (user_id,date) => {
    return axios({
        url: server+'/todolist',
        method: 'post',
        data: {
            user_id: user_id,
            date: date,
        },
        responseType: 'json'
    })
};
